import { useEffect, useState } from "react"
import { useDispatch, useSelector } from "react-redux";
import { getMangaList } from "../features/manga/mangaSlice"
import Manga from "../components/Manga"
import '../styles/mangaList.css'

const MangaList = () => {
    // console.log(useSelector((store)=>console.log(store)))
    const dispatch = useDispatch(); 
    const [manga] = useState(useSelector((store) => store.manga.mangaList))
    console.log(manga)
    useEffect(()=>{
        dispatch(getMangaList())
        console.log(manga)
    },[])
    return(
        <div>
            <h1>Manga List</h1>
            <div className="containerMangaList">
            {
                manga.map((manga, index) => 
                    <Manga 
                        manga = {manga}
                        key = {index}
                    />)
            }
            </div>
        </div>
    )
}

export default MangaList
